import React from 'react';
import Container from 'react-bootstrap/Container';

function ContactPage(props) {
    return (
        <Container fluid={true}>
            <h2>{props.title}</h2>
            <form>
                <text />
            </form>
        </Container>
    );
}

export default ContactPage;
